import Link from 'next/link';
import { GlobalContext } from './GlobalContext';


function Decide(props) {
    const state = React.useContext(GlobalContext);
    if(this.state.hold == false){
        return (
            <div>
                <div>1state falseyyyy {state.isLoggedIn}</div>
                <Navigation title="Dashboard" page="/login" />
            </div>

        )
    }
    else {
        if (state.isVolunteer == true){
            return (
                <div>
                    <div>2state {state.isLoggedIn}</div>
                    <Navigation title="Dashboard" page="/userDash" />
                </div>

            )
        } else {
            return (
                <div>
                    <Navigation title="Dashboard" page="/orgDash" />
                    <div>3state {state.isLoggedIn}</div>
                </div>

            )
        }
    }
}

const linkStyle = {
    marginRight: 15
}

const Navigation = props => (
    <Link href={props.page}>
        <a style={linkStyle}>{props.title}</a>
    </Link>
)

this.setState({ hold: state.isLoggedIn });

class Header extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            hold: true,
        }
    }

    render() {
        return (
            <div>
                <Navigation title="Home" page="/" />
                <Navigation title="About Us" page="/aboutUs" />
                <Decide title="Dashboard" />
                <Navigation title="Opportunities" page="/opps" />
                <Navigation title="Log In" page="/login" />
            </div>
        )
    }
}

export default Header;
